replies.commentText:
Люба, вдруг таки прочитаешь.
1) не тараторь, тебя никто не гонит, а если гонит - расскажи как они не правы. Информация не воспринимается от монотонного монолога на скорости Канделаки;
2) передай привет монтажеру и звуковику. Фразы обрываются будто на полуслове. Из за этого и так очень слабо расставленные интонационные акценты теряются и внимание заостряется лишь на этом режущем ухо обрывании фраз;
3) при крупном плане над головой пол экрана пустого фона, за столом - процентов 80. Нужны более крупные планы, более верные композиционно кадры.

Олег Агафонов, красиво вырываешь из контекста как будто увеличение законодательно рекомендовано от текущих рыночных цен... на самом деле приведенные статьи приказа Минэкономразвития N 567 относятся только к статье 3.7.3 того же приказа, а именно при поиске ценовой информации в реестре контрактов, заключенных заказчиками на аналогичные товары/услуги в течении последних ТРЁХ ЛЕТ. Т.е. при определении начальной максимальной цены контракта допустимо/рекомендовано увеличение в пределах установленных в процитированных статьях от старых закупочных цен из реестра исполненных контрактов. Из-за инфляции, естественно, цены 1-3 годичной давности можно пересматривать в сторону увеличения, но это не даёт право накидывать на текущие цены...  с другой стороны доказать коррупционную составляющую в нынешних реалиях возможно только поймав с поличным заинтересованных фигурантов при передаче отката (но это никому не нужно). Формально заказчик при определении НМЦК выполнил требования кривого ФЗ по госзакупкам и направил "своим" (закон никак не регламентирует каким) конторам запросы цен, те нарисовали "нужные" (завышенные) цены, отсюда на законных основаниях) сформировалась завышенная начальная максимальная цена контракта, в документации к заказу заказчик прописывает  некоторые невыполнимые пункты (например, короткий срок поставки при большом объеме и т.п.), чтобы желание участвовать в торгах отпало у поставщиков "с улицы", далее в ходе торгов начальная цена для приличия немного снижается и заключается контракт с одной из "своих" контор-поставщиков и далее откаты-распилы, хорошо если хотя бы товар/услугу поставят, бывает, что и не поставляется ничего). Большинство госзакупок проводят примерно по такой схеме, при этом с точки зрения кривого закона ко многим не подкопаешься.




Более полная выдержка из приказа Минэкономразвития N 567:
_
3.7.3. осуществить поиск ценовой информации в реестре контрактов, заключенных заказчиками. При этом целесообразно принимать в расчет информацию о ценах товаров, работ, услуг, содержащуюся в контрактах, которые исполнены и по которым не взыскивались неустойки (штрафы, пени) в связи с неисполнением или ненадлежащим исполнением обязательств, предусмотренных этими контрактами, в течение последних трех лет. Рекомендации по поиску общедоступной ценовой информации, содержащейся в реестре контрактов, заключенных заказчиками, приведены в приложении N 2 к настоящим Рекомендациям;
_
...
_
3.16. При использовании в целях определения НМЦК ценовой информации, полученной в соответствии с пунктом 3.7.3 настоящих Рекомендаций, заказчиком, уполномоченным органом, уполномоченным учреждением дополнительно может быть скорректирована цена товара, работы, услуги в зависимости от способа осуществления закупки, явившейся источником информации о цене товара, работы, услуги. При этом рекомендуется использовать следующий порядок:

3.16.1. если закупка осуществлялась путем проведения конкурса - цену товара, работы, услуги при необходимости рекомендуется увеличивать не более чем на 10%;

3.16.2. если закупка осуществлялась путем проведения аукциона - цену товара, работы, услуги при необходимости рекомендуется увеличивать не более чем на 13%;

3.16.3. если закупка осуществлялась путем проведения запроса котировок, запроса предложений - цену товара, работы, услуги при необходимости рекомендуется увеличивать не более чем на 17%;

3.16.4. если закупка осуществлялась у единственного поставщика (подрядчика, исполнителя) - цена товара, работы, услуги в соответствии с настоящим пунктом не корректируется.
_

